import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/widgets.dart';

class ImagesSet extends ChangeNotifier {
  Map<String, Uint8List> images = {};

  Map<String, String> imageStrings = {
    'apple':
        '',
    'baby':
        '',
    'cookie':
        '',
    'dog':
        '',
    'egg':
        '',
    'frog':
        '',
    'grape':
        '',
    'hamster':
        '',
    'ice cream':
        '',
    'jellyfish':
        '',
    'kiwi':
        '',
    'lion':
        '',
    'muffin':
        '',
    'newt':
        '',
    'orange':
        '',
    'puppy':
        '',
    'quiche':
        '',
    'rabbit':
        '',
    'sandwich':
        '',
    'turtle':
        '',
    'udon':
        '',
    'viper':
        '',
    'waffle':
        '',
    'xerus':
        '',
    'yogurt':
        '',
    'zebra':
        '',
  };

  Uint8List convertToUint8(base64String) {
    Uint8List bytes = base64Decode(base64String);
    return bytes;
  }

  void setImages() {
    for (var image in imageStrings.entries) {
      images[image.key] = convertToUint8(image.value);
    }
  }
}
